import React from 'react'
import {FeedbackLikeMutation} from 'FeedbackLikeMutation.graphql';
import graphql from "babel-plugin-relay/macro";
import {useMutation} from "react-relay"

export default function Profile() {

    const [commit, isInFlight] = useMutation<FeedbackLikeMutation>(graphql`
    mutation ProfileFeedbackLikeMutation($input: String!) {
        updateRepository(
            input: { repositoryId: "R_kgDOGTgzxA", name: $input }
          ) {
            repository {
              createdAt
              nameWithOwner
              name
              id
            }
          }
        }
  `);

  if (isInFlight) {
    return <Spinner />;
  }

    return (
          <button
      onClick={() => {
        commit({
          variables: {
            input: {
              id: '123',
              text: 'text',
            },
          },
          onCompleted(data) {
            console.log(data);
          },
        });
      }}
    />
    )
}
